import React, {useState} from 'react';
import Pation from './Pation';
import Apointment from './Appointment';
import Drug from './Drug';


const Navbar=()=> {
const [navLinkOpen,navLinkToggle] = useState(false);
  const handelNavlinksToogel=()=>{
    navLinkToggle(!navLinkOpen);
  }
  const renderClasses =()=>{
    let classes ="navlinks";
    if (navLinkOpen){
      classes +="active"
    }
    return classes
  }
  return (
<div className="photo">
<nav>
<div className="logo">
<i class="fas fa-heartbeat"></i>
<h4> health</h4>
</div>
<ul className={renderClasses()}>
    <li className="link"><a href="#"> home </a></li>
    <li className="link"><a href="#"> patient </a></li>
    <li className="link"><a href="#"> Apointment </a></li>
    <li className="link"><a href="#"> drug </a></li>
    <li className="link"><a href="#"> logout </a></li>
   </ul>
<div onClick={handelNavlinksToogel} className="humburger-toggle">
<i class="fas fa-bars fa-lg"></i>
</div>
</nav>
</div>
  );
}

export default Navbar;
